    ((s@r,c),w,(r,c'))\<in>trcl (trss fg); 
    !!wa wb ch. \<lbrakk> w=wa@wb; ((s,c),wa,([],ch))\<in>trcl (trss fg); 
                  ((r,ch),wb,(r,c'))\<in>trcl (trss fg) \<rbrakk> \<Longrightarrow> P 
  \<rbrakk> \<Longrightarrow> P"
