lemma writeExtendCorrect:
  "[| nextFreeBlockInvariant cfile1;
      unallocatedBlocksInvariant cfile1;
      lastBlockInvariant cfile1;
      ~ index < fileSize cfile1;
      Some cfile2 = cfWrite cfile1 index value
   |] ==> Some (abstFn cfile2) = afWrite (abstFn cfile1) index value"

lemma (in PolynRg) polyn_deg_add5:"\<lbrakk>p \<in> carrier R; q \<in> carrier R; 
       (deg R S X p) \<le> a; (deg R S X q) \<le> a\<rbrakk>  \<Longrightarrow> 
                                deg R S X (p \<plusminus> q) \<le> a"

lemma (in Ring) bilinear_l_lin:"\<lbrakk>R module M1; R module M2; R module N; 
      m1 \<in> carrier M1; m2 \<in> carrier M2; r \<in> carrier R; 
      bilinear_map f R M1 M2 N\<rbrakk> \<Longrightarrow> f (r \<cdot>\<^sub>s\<^bsub>M1\<^esub> m1, m2) = r \<cdot>\<^sub>s\<^bsub>N\<^esub> (f (m1, m2))"

lemma writeSucceedCorrect:
  "[| nextFreeBlockInvariant cfile1;
      unallocatedBlocksInvariant cfile1;
      lastBlockInvariant cfile1;
      Some cfile2 = cfWrite cfile1 index value
   |] ==> Some (abstFn cfile2) = afWrite (abstFn cfile1) index value"

theorem wlsAbs_fresh_cases:
assumes "wlsAbs (xs,s) A" and "wlsPar P"
and "\<And> x X.
          \<lbrakk>wls s X;
           \<And> ys. x \<notin> varsOfS P ys;
           \<And> s' Y. Y \<in> termsOfS P s' \<Longrightarrow> fresh xs x Y;
           \<And> us s' B. B \<in> absOfS P (us,s') \<Longrightarrow> freshAbs xs x B;
           \<And> rho. rho \<in> envsOfS P \<Longrightarrow> freshEnv xs x rho\<rbrakk>
           \<Longrightarrow> phi (xs,s) (Abs xs x X) P"
shows "phi (xs,s) A P"

private lemma prog_unclocked_2:
  assumes "evaluate_prog False env (s \<lparr> clock := cnt1 \<rparr>) prog (s' \<lparr> clock := cnt1 \<rparr>,r)"
  shows "evaluate_prog False env (s \<lparr> clock := cnt2 \<rparr>) prog (s' \<lparr> clock := cnt2 \<rparr>,r)"

lemma simple_greedy_approximation:
"VARS T A i j
{True}
T := (\<lambda>_. 0);
A := (\<lambda>_. {});
j := 0;
WHILE j < n INV {inv\<^sub>1 T A j} DO
  i := min_arg T m;
  j := (Suc j);
  A := A (i := A(i) \<union> {j});
  T := T (i := T(i) + t j)
OD
{lb T A n \<and> (\<forall>T' A'. lb T' A' n \<longrightarrow> makespan T \<le> 2 * makespan T')}"

lemma (in Module) fsps_chain_boundTr2:"\<And>x. \<lbrakk>R module N; free_generator R M H;
       f \<in> H \<rightarrow> carrier N; C \<subseteq> fsps R M N f H;  
       \<forall>a\<in>C. \<forall>b\<in>C. fst a \<subseteq> fst b \<or> fst b \<subseteq> fst a; 
       x \<in> (fgs R M (\<Union>{a. \<exists>b. (a, b) \<in> C})); C \<noteq> {}\<rbrakk>  \<Longrightarrow> 
    (THE y. y \<in> carrier N \<and> (\<exists>a b. (a, b) \<in> C \<and> x \<in> fgs R M a \<and> y = b x)) \<in> 
    (carrier N) \<and> 
    (\<exists>a1 b1. (a1, b1) \<in> C \<and> x \<in> fgs R M a1 \<and> 
    (THE y. y \<in> carrier N \<and> (\<exists>a b. (a, b) \<in> C \<and> x \<in> fgs R M a \<and> y = b x)) = 
              b1 x)"

lemma (in Corps) mgenerator1:"\<lbrakk>distinct_pds K n P; ideal (O\<^bsub>K P n\<^esub>) I; 
 I \<noteq> {\<zero>\<^bsub>(O\<^bsub>K P n\<^esub>)\<^esub>}; I \<noteq> carrier (O\<^bsub>K P n\<^esub>); j \<le> n\<rbrakk> \<Longrightarrow>
((\<nu>\<^bsub>K (P j)\<^esub>) (mprod_exp K (mL K P I) (Kb\<^bsub>K n P\<^esub>) n)) = ((\<nu>\<^bsub>K (P j)\<^esub>) (Zl_mI K P I j))"

lemma while_upt_while_direct:
  "b \<ge> a \<Longrightarrow>
  do {
    (_,\<sigma>) \<leftarrow> WHILE\<^sub>T (FOREACH_cond c) (\<lambda>x. do {ASSERT (FOREACH_cond c x); FOREACH_body f x})
      ([a..<b],\<sigma>);
    RETURN \<sigma>
  } = do {
    (_,\<sigma>) \<leftarrow> WHILE\<^sub>T (\<lambda>(i, x). i < b \<and> c x) (\<lambda>(i, x). do {ASSERT (i < b);  \<sigma>'\<leftarrow>f i x; RETURN (i+1,\<sigma>')
}) (a,\<sigma>);
    RETURN \<sigma>
  }"

lemma (in Order) fixp_same:"\<lbrakk>W1 \<subseteq> carrier D; W2 \<subseteq> carrier D; t \<in> W1; 
 b \<in> carrier D; ord_isom (Iod D W1) (Iod (Iod D W2) (segment (Iod D W2) b)) g;
 \<forall>u\<in>segment (Iod D W1) t. fixp g u\<rbrakk> \<Longrightarrow> 
          segment (Iod D W1) t = segment (Iod D W2) (g t)"

lemma JHS_Tr1_3:"\<lbrakk>Group G; 0 < r; 0 < s; compseries G r f; compseries G s g;
       i \<le> s * r - Suc 0; Suc (rtos r s i) < s * r; Suc i < s * r;
       i mod s < s - Suc 0; Suc i div s \<le> r - Suc 0; i div s = r - Suc 0\<rbrakk>
    \<Longrightarrow> Group (Gp G (f r \<diamondop>\<^bsub>G\<^esub> (f (r - Suc 0) \<inter> g (i mod s))) /
        (f r \<diamondop>\<^bsub>G\<^esub> (f (r - Suc 0) \<inter> g (Suc (i mod s)))))"

lemma halt_lemma2''':
  "\<lbrakk>\<forall>n. \<not> P (f n) \<and> Q (f n) \<longrightarrow> Q (f (Suc n)) \<and> (f (Suc n), f n) \<in> LE;
                 Q (f 0);  \<forall>i<na. \<not> P (f i)\<rbrakk> \<Longrightarrow> Q (f na)"

lemma seq_step_invariant_ctermI [intro]:
  assumes wf: "wellformed \<Gamma>"
      and cw: "control_within \<Gamma> (init A)"
      and sl: "simple_labels \<Gamma>"
      and sp: "trans A = seqp_sos \<Gamma>"
      and step: "\<And>p pp l \<xi> a q l' \<xi>'. \<lbrakk>
                 p\<in>cterms \<Gamma>;
                 l\<in>labels \<Gamma> p;
                 ((\<xi>, p), a, (\<xi>', q)) \<in> seqp_sos \<Gamma>;
                 ((\<xi>, p), a, (\<xi>', q)) \<in> trans A;
                 l'\<in>labels \<Gamma> q;
                 (\<xi>, pp) \<in> reachable A I;
                 p\<in>sterms \<Gamma> pp;
                 (\<xi>', q) \<in> reachable A I;
                 I a
               \<rbrakk> \<Longrightarrow> P ((\<xi>, l), a, (\<xi>', l'))"
    shows "A \<TTurnstile>\<^sub>A (I \<rightarrow>) onll \<Gamma> P"

private lemma lfinite_wit[simp]:
  assumes "chain R\<^sup>+\<^sup>+ xs"
  shows "lfinite (wit xs) \<longleftrightarrow> lfinite xs"

lemma onll_step_to_invariantI [intro]:
  assumes sinv: "A \<TTurnstile>\<^sub>A (I \<rightarrow>) onll \<Gamma> Q"
      and wf: "wellformed \<Gamma>"
      and init: "\<And>\<xi> l p. \<lbrakk> (\<xi>, p) \<in> init A; l\<in>labels \<Gamma> p \<rbrakk> \<Longrightarrow> P (\<xi>, l)"
      and step: "\<And>\<xi> p l \<xi>' l' a.
                   \<lbrakk> (\<xi>, p) \<in> reachable A I;
                     l\<in>labels \<Gamma> p;
                     P (\<xi>, l);
                     Q ((\<xi>, l), a, (\<xi>', l'));
                     I a\<rbrakk> \<Longrightarrow> P (\<xi>', l')"
    shows "A \<TTurnstile> (I \<rightarrow>) onl \<Gamma> P"

lemma isom_gch_units_transpTr1:"\<lbrakk>Ugp E; Gchain n g; i \<le> n; j \<le> n; g j \<cong> E; 
      i \<noteq> j\<rbrakk> \<Longrightarrow> 
      insert j ({i. i \<le> n \<and> g i \<cong> E} - {i, j}) = {i. i \<le> n \<and> g i \<cong> E} - {i}"

lemma cidrsplit_no_overlaps: "\<lbrakk>
        x \<in> set (wordinterval_CIDR_split_prefixmatch wi);
        xa \<in> set (wordinterval_CIDR_split_prefixmatch wi); 
        pt && ~~ (pfxm_mask x) = pfxm_prefix x;
        pt && ~~ (pfxm_mask xa) = pfxm_prefix xa
        \<rbrakk>
       \<Longrightarrow> x = xa"

lemma (in Module) unique_exprTr7p1:"  \<lbrakk>free_generator R M H;
  \<forall>f s g t m.
   f \<in> {j. j \<le> n} \<rightarrow> H \<and> inj_on f {j. j \<le> n} \<and> s \<in> {j. j \<le> n} \<rightarrow> carrier R \<and>
   g \<in> {j. j \<le> m} \<rightarrow> H \<and> inj_on g {j. j \<le> m} \<and> t \<in> {j. j \<le> m} \<rightarrow> carrier R \<and>
   l_comb R M n s f = l_comb R M m t g \<and> 
         (\<forall>j\<le>n. s j \<noteq> \<zero>\<^bsub>R\<^esub>) \<and> (\<forall>k\<le>m. t k \<noteq> \<zero>\<^bsub>R\<^esub>) \<longrightarrow>
           n = m \<and>
   (\<exists>h. h \<in> {j. j \<le> n} \<rightarrow> {j. j \<le> n} \<and>
                (\<forall>l\<le>n. cmp f h l = g l \<and> cmp s h l = t l));
   f \<in> {j. j \<le> Suc n} \<rightarrow> H; s \<in> {j. j \<le> Suc n} \<rightarrow> carrier R;
   g \<in> {j. j \<le> Suc n} \<rightarrow> H; t \<in> {j. j \<le> Suc n} \<rightarrow> carrier R;
   l_comb R M (Suc n) s f = l_comb R M (Suc n) t g; \<forall>j\<le>Suc n. s j \<noteq> \<zero>\<^bsub>R\<^esub>;
   \<forall>k\<le>Suc n. t k \<noteq> \<zero>\<^bsub>R\<^esub>; inj_on f {j. j \<le> Suc n}; inj_on g {j. j \<le> Suc n}; 
   f (Suc n) = g (Suc n)\<rbrakk> \<Longrightarrow> \<exists>h. h \<in> {j. j \<le> Suc n} \<rightarrow> {j. j \<le> Suc n} \<and>
              (\<forall>l\<le>Suc n. cmp f h l = g l \<and> cmp s h l = t l)"

lemma RedT_induct' [consumes 1, case_names refl step]:
  "\<lbrakk> s -\<triangleright>ttas\<rightarrow>* s';
     P s [] s;
     \<And>ttas s' t ta s''. \<lbrakk> s -\<triangleright>ttas\<rightarrow>* s'; P s ttas s'; s' -t\<triangleright>ta\<rightarrow> s'' \<rbrakk> \<Longrightarrow> P s (ttas @ [(t, ta)]) s''\<rbrakk>
  \<Longrightarrow> P s ttas s'"

lemma rel_FGcontra_mono:
  "\<lbrakk> L1 \<le> L1'; Co1 \<le> Co1'; Co2 \<le> Co2'; Co3 \<le> Co3'; Co4 \<le> Co4'; Co5 \<le> Co5';
     Contra1' \<le> Contra1; Contra2' \<le> Contra2; Contra3' \<le> Contra3;
     Contra4' \<le> Contra4; Contra5' \<le> Contra5 \<rbrakk> \<Longrightarrow>
  rel_FGcontra L1 Co1 Co2 Co3 Co4 Co5 Contra1 Contra2 Contra3 Contra4 Contra5 \<le>
  rel_FGcontra L1' Co1' Co2' Co3' Co4' Co5' Contra1' Contra2' Contra3' Contra4' Contra5'"

lemma integer_division2: 
  "PRE (\<lambda>s::nat store. x \<ge> 0)
    (''q'' ::= (\<lambda>s. 0)); 
    (''r'' ::= (\<lambda>s. x));
    (WHILE (\<lambda>s. y \<le> s ''r'') INV (\<lambda>s. x = s ''q'' * y + s ''r'' \<and> s ''r'' \<ge> 0)
     DO
      (''q'' ::= (\<lambda>s. s ''q'' + 1));
      (''r'' ::= (\<lambda>s. s ''r'' - y))
      OD)
   POST (\<lambda>s. x = s ''q'' * y + s ''r'' \<and> s ''r'' \<ge> 0 \<and> s ''r'' < y)"

lemma (in Corps) Ostrowski_baseTr2:"\<lbrakk>vals_nonequiv K (Suc n) vv; 
        l \<le> (Suc n); m \<le> (Suc n); l \<noteq> m\<rbrakk> \<Longrightarrow>
        0 < ((vv m) (Ostrowski_base K vv (Suc n) l))"

lemma "let P = Atom (0 :: nat); Q = Atom 1; R = Atom 2; T = Atom 3;
\<phi> = (\<^bold>\<not>(P \<^bold>\<and> Q)) \<^bold>\<rightarrow> (\<^bold>\<not>R \<^bold>\<and> Q);
\<psi> = (T \<^bold>\<rightarrow> P) \<^bold>\<or> (T \<^bold>\<rightarrow> (\<^bold>\<not>R));
I = interpolate \<phi> \<psi> in
(size I) = 23 \<and> simplify_consts I = Atom 2 \<^bold>\<rightarrow> Atom 0"

lemma (in Corps) Pseq_decompos:"\<lbrakk>valuation K v; PolynRg R (Vr K v) X;
      F n \<in> carrier R; deg R (Vr K v) X (F n) \<le> an (Suc d)\<rbrakk>
      \<Longrightarrow> F n = ((Pseql\<^bsub>R X K v d\<^esub> F) n) \<plusminus>\<^bsub>R\<^esub> ((Pseqh\<^bsub>R X K v d\<^esub> F) n)"
